import { Component } from "react";
import "./PodcastData.css";
export default class PodcastData extends Component {
  constructor(props) {
    super(props);
    this.state = {
      imageB64:
        "",
      name: props.name,
      artist: props.artist,
      collection: props.collection ?? "",
    };
  }

  render() {
    return (
      <div style={{ border: 5, borderColor: "red", minHeight: 350 }}>
        <div>
          <img
            style={{ width: 200, cursor: "default" }}
            src={`data:image/jpeg;base64,${this.state.imageB64}`}
            alt={`${this.state.artist} work cover.`}
          />
        </div>
        <div className="LowerCardTextStyle">
          <p
            style={{ cursor: "default" }}
          >{`Podcast Title: ${this.state.name}`}</p>
          <p
            style={{ cursor: "default" }}
          >{`Description: ${this.state.artist}`}</p>
          <p>
            <a
              href={this.state.collection}
              target="_blank"
              rel="noopener noreferrer"
              className="play-button-link"
            >
              <span className="play-button-icon">▶</span> Click to play
            </a>
          </p>
        </div>
      </div>
    );
  }
}
